import { GoogleMap, LoadScript } from '@react-google-maps/api';

const containerStyle = {
  width: '85vw',
  height: '65vh',
  margin: '3vh',
};

const center = {
  lat: 42.70,
  lng: -84.644
};

function MapComponent({ onClick }) {
  return (
    <LoadScript googleMapsApiKey={"AIzaSyAxbAf8Ob88i06AIUWdjgJVCdEetuCPdAY"}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={10}
        onClick={onClick}  // This will trigger the parent's handleMapClick method
      >
      </GoogleMap>
    </LoadScript>
  );
}

export default React.memo(MapComponent);
